import Nav from './components/Nav';
import Splash from './components/Splash';

export default function HomePage() {
  const projectCards = [
    //ProjectCard("img/one-ai.png", "One AI", "ASDF", "https://github.com/quaxlyqueen/one-ai"),
    <ProjectCard img="img/one-ai.png" title="One AI" description="ASDF" url="https://github.com/quaxlyqueen/one-ai"/>,
    <ProjectCard img="img/one-ai.png" title="One AI" description="ASDF" url="https://github.com/quaxlyqueen/one-ai"/>,
    <ProjectCard img="img/one-ai.png" title="One AI" description="ASDF" url="https://github.com/quaxlyqueen/one-ai"/>,
    <ProjectCard img="img/one-ai.png" title="One AI" description="ASDF" url="https://github.com/quaxlyqueen/one-ai"/>
  ];
  return (
    <>
      <Nav />
      <Splash primaryText="Hi, I'm Josh Ashton!" secondaryText="Junior full stack developer."/>
      <FeaturedContent content={projectCards} />
      <Footer />
    </>
  );
}

/*
 * Expects an array of Cards to display in a responsive grid.
 *
 * @param ProjectCard[] content "An array of ProjectCards or other Cards."
 */
function FeaturedContent( {content} ) {
  // TODO: Need to implement dynamic grid layout.
  // TODO: Need to implement dynamic number of content, based on content size.
  return (
    <>
      <div className="row">
        {content[0]}
        {content[1]}
      </div>
      <div className="row">
        {content[2]}
        {content[3]}
      </div>
    </>
  );

}

/*
 * Create a ProjectCard.
 *
 * @param String img "Path to an image."
 * @param String title "Title of the card."
 * @param String description "A short description for the card."
 * @param String url "URL to a project."
 *
 * TODO: Need to add classes and styling.
 */
function ProjectCard( {img, title, description, url} ) {
  return (
    <>
      <div>
        <img src={img} />
        <div>
          <h2>{title}</h2>
          <p>{description}</p>
          <a target="_blank" href={url}>View Code on GitHub</a>
        </div>
      </div>
    </>
  );
}

function Footer() {
  return (
    <>
      <div>
        <p>Copyright or open source license here.</p>
        <ul>
          <li><a href="contact">Contact</a></li>
          <li><a href="contact">Contact</a></li>
          <li><a href="contact">Contact</a></li>
          <li><a href="contact">Contact</a></li>
        </ul>
      </div>
    </>
  );
}
